              if (this.displayChess[i] >= 8) {
                // console.log(i);
                havePcNum++
                isHavePc = true
                if (havePcNum > 1) break
              }
              i -= 16
            }

          }
        } else {
          if (item > 0) {//
            for (let i = sqSrc + 1; i < sqDest; i++) {
              if (this.displayChess[i] >= 8) {
                havePcNum++
              }
              if (havePcNum > 1) break
            }
          } else {//
            for (let i = sqSrc - 1; i > sqDest; i--) {
              if (this.displayChess[i] >= 8) {
                havePcNum++
              }
              if (havePcNum > 1) break
            }
          }
        }
        /**/
        let flag = false
        if (this.playerSide) {//
          if (this.displayChess[sqDest] & 16) {//
            flag = true
          }
        } else {
          if (this.displayChess[sqDest] & 8) {//
            flag = true
          }
        }
        return (this.RANK_Y(sqSrc) === this.RANK_Y(sqDest) || this.FILE_X(sqSrc) === this.FILE_X(sqDest)) //
            && ((havePcNum === 1 && flag) || havePcNum === 0)
      }
      else if (pieNum === this.pieceNumber.pawn) {//
        let sd, //
            flag1 = false, //
            flag2 = false //
        if (this.pcSelfSide === 16) {//
          sd = 1
          if (item === 16) flag2 = true
        } else if (this.pcSelfSide === 8) {//
          sd = 0
          if (item === -16) flag2 = true
        }

        if (this.AWAY_HALF(sqDest, sd)) {
          if (Math.abs(item) === 1) {
            flag1 = true
          }
        }
        return flag2 || flag1
      }
      else
        console.log('');
